// This is the JSON way to define React Router rules in a Rekit app.
// Learn more from: http://rekit.js.org/docs/routing.html

import { Layout } from './';
import Autoreply from './Autoreply';
import Complaint from './Complaint';
import Favourite from './Favourite';
import MessagesList from './MessagesList';
import Offer from './Offer';
import Question from './Question';
import Review from './Review';

export default {
  path: 'messages',
  component: Layout,
  name: "Сообщения",
  childRoutes: [
    {path: "index", component: MessagesList, isIndex: true, name: "Все сообщения"},
    {path: "complaint", component: Complaint, name: "Жалобы"},
    {path: "offer", component: Offer, name: "Предложения"},
    {path: "review", component: Review, name: "Отзывы"},
    {path: "question", component: Question, name: "Вопросы"},
    {path: "favourite", component: Favourite, name: "Избранные"},
    {path: "autoreply", component: Autoreply, name: "Автоответчик"},
  ],
};
